import calendar_img from './images/demo_calendar.jpeg';
import logo from './images/ec 030123.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} style={{backgroundColor: 'style={{height:100, width:100}}', width:'100vmin'}}/>
        <img src={calendar_img} style={{height:'100vmin', width:'100vmin'}}/>
      </header>
    </div>
  );
}

export default App;
